import React from "react";
import ReactDOM from 'react-dom';
 
function Time() {
    const myElement = (
        <div>
            <h2 className="-mt-80 text-lg">Today's Date :{new Date().toDateString()} | {new Date().toLocaleTimeString()}</h2>
        </div>
    );
 
    ReactDOM.render(
        myElement,
        document.getElementById("roots")
    );
}
 
setInterval(Time, 1000);
 
export default Time;
